  Route,
  Routes,
  Link,
  // navigate,
  useNavigate,
} from "react-router-dom";
function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/"
          element={
            <ProtectedRoute user={user} setUser={setUser}>
              {currform === "Login" ? (
                <Login
                  onFormSwitch={toggleform}
                  setUser={setUser}
                  setuser_name={setuser_name}
                  setmobile={setmobile}
                  setfirst_name={setfirst_name}
                  setsecond_name={setsecond_name}
                  setemail={setemail}
                />
              ) : (
                <Signup onFormSwitch={toggleform} />
              )}
            </ProtectedRoute>
          }
        />
        <Route
          path="/Profile_page"
          element={
            <ProtectedLogin1 user={user}>
              <Profile_page
                user_name={user_name}
                mobile={mobile}
                first_name={first_name}
                second_name={second_name}
                email={email}
              />
            </ProtectedLogin1>
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
